        "#  define a function to create a spesific range of data between two number with  Float Numbers\n",
        "def range_with_floats(start, stop, step):\n",
        "    # Works only with positive float numbers!\n",
        "    while stop >= start:\n",
        "        yield start\n",
        "        start += step\n",
